def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n == 0:
        return "0"
    if n < 0:
        return ""
    num = n
    while num:
        if num > 0:
            num = num % 10
        else:
            return ""
        yield num
        num = num / 10

def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n == 0:
        return '0'
    else:
        return''.join(string_sequence(i) for i in range(0, n))

