def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n == 0:
        return '0'
    if n < 0:
        raise ValueError('negative integer passed to string_sequence')
    return''.join([str(i) for i in range(0, n + 1)])

def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n == 0:
        return '0'
    if n == 1:
        return '1'
    if n == 2:
        return '2'
    if n == 3:
        return '3'
    if n == 4:
        return '4'
    return''.join(map(str, range(n, n + 1)))

def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n < 0:
        raise ValueError("negative length")
    return''.join(chr(i) for i in range(n))

